custom_css:
[data-doctype="Web Form"] main 
{
    width:50%;
    height:50%;
}


.page-content-wrapper{
    /*background:red;*/
}
.web-form-actions{
    display:none;
}
.page-header{
     display:none; 
}
.container{
    border:none;
    border-radius:10px;
    box-shadow:4px 4px 10px rgba(0,0,0,0.06);
    
}
.form-layout{
    padding:25px;
    border-radius:5px;
}
hr{
    visibility:hidden;
}
.section-head{
    color:#004f94;
   
}
.navbar-brand{
    color:#004f94;
}
.input-with-feedback{
    border:none;
    border-radius:10px;
    box-shadow:4px 4px 10px rgba(0,0,0,0.06);
}
.input-with-feedback:hover{
    outline-style:none;
}

:root {
  input-border: black;
  input-focus-h: 245;
  input-focus-s: 100%;
  input-focus-l: 42%;
}


.input-with-feedback:focus {
  border-color: hsl(
    var(--input-focus-h),
    var(--input-focus-s),
    var(--input-focus-l)
  );
  box-shadow: 0 0 0 3px
    hsla(
      var(--input-focus-h),
      var(--input-focus-s),
      calc(var(--input-focus-l) + 40%),
      0.8
    );
  outline: 1px solid black;
}
.pull-right{
    visibility:hidden; 
}
.navbar,.web-footer{
    display:none;
}
